import React, {Component} from 'react';
import './App.css';
import HealRequestForm from './HealRequestForm';
import Instructions from './Instructions';
import Footer from './Footer';



class App extends Component {



  render(){
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div className="instructions container">
        <Instructions />
      </div>
      <div className="heal-request container">
      <HealRequestForm  />
      <Footer />
      </div>
    </div>
  );
}
};

export default App;
